INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (18814, 0, 0, 11, 1, "ケーキとは別に、プレゼントも\nいくつか用意してあるのよ。\n私たちじゃどんなのがいいか\nよく分からなかったから……", 18814081, 10, 0.5, 1, 105111);
