INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (19814, 0, 0, 11, 1, "このおいしそうなケーキは……ハッ！？\nワタシの命を狙う、アクダイカンの\n仕組んだトラップでショウか？", 19814071, 10, 0.5, 1, 103011);
