INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (19814, 0, 0, 11, 1, "そんなわけあるか！！\n今日はニノンの誕生日なんだから、\nお祝いのケーキに決まっているだろう！", 19814076, 10, 0.5, 1, 105311);
