INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (19814, 0, 0, 11, 1, "で、でも、お祝いのケーキによって\n痛い思いをさせられたら、より高い\nところから突き落とされたみたいで\n興奮しますね……じゅるり♪", 19814081, 10, 0.5, 1, 104511);
