INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (19814, 0, 0, 11, 1, "ワタシの誕生日ケーキ！？\nそれは大変、ゴブレイしマシタ♪\n本来であればセップクものですが、\n腹よりケーキを切りまショウ♪", 19814091, 10, 0.5, 1, 103011);
