INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (27814, 0, 0, 11, 1, "お、お誕生日\nおめでとうございます、クウカさん。\nせ、せっかく、ケーキを用意したので、\nみんなでこれを食べませんか……？", 27814078, 10, 0.5, 1, 105511);
