INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (31114, 0, 0, 11, 1, "ほ、欲しかったボードゲームが\nあるんですけど……いや、でも、\nあれって結構高かったっけ……？\nシノブさんにおねだりするのは……", 31114086, 10, 0.5, 1, 102211);
