INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (31114, 0, 0, 11, 1, "これ、お主たち。\nシノブの誕生日じゃというのに、\nお返しの話題で盛り上がるでないわ。\nまったく、こやつらは……", 31114091, 10, 0.5, 1, 104411);
