INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (31114, 0, 0, 11, 1, "大丈夫ですよ、イリヤさん。\nいつも通りの、自由な雰囲気で\n祝ってもらう方が気も楽ですから。\nあなたも、きっとそうですよね？", 31114096, 10, 0.5, 1, 103111);
