INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (34314, 0, 0, 11, 1, "もちろん、甘々で、プルプルのプリンを\nたくさん用意してきたよ～♪\n一度に頬張ったら、お口から\n垂れてきちゃうかも～♪", 34314076, 10, 0.5, 1, 100611);
