INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (34414, 0, 0, 11, 1, "みんな、今日は私の誕生日を\nお祝いしてくれてありがとう♪\nこういう時って、やっぱりバースデー\nライブとかした方がいいのかな？", 34414058, 10, 0.5, 1, 102911);
