INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (38614, "", "", 21, "", "vo_wac_38614_002", 38614078, 0, "", 0, "vo_wac_38614");
INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (38614, 0, 0, 11, 1, "いえ、あのね？\nテーブルの下に、未使用のロウソクが\n大量に袋詰めしてあるんだけど。\nこれは、なに？", 38614079, 10, 0.5, 1, 105111);
INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (38614, "", "", 91, "", "", 38614080, "", "", "", 0);
