INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (38614, "", "", 21, "", "vo_wac_38614_003", 38614083, 0, "", 0, "vo_wac_38614");
INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (38614, 0, 0, 11, 1, "ああ、ミツキの年の数だけ\nロウソクを買ったつもりが、\nいざ実際の年齢を確認してみたら\n思ったより余ってしまって……", 38614084, 10, 0.5, 1, 100911);
INSERT INTO `v1_449a8fb1a473646209d73bbe2bb3642e027df13561903c707f019c521c4e758c` VALUES (38614, "", "", 91, "", "", 38614085, "", "", "", 0);
